def listar(request):
    vehiculos = Vehiculo.objects.all()
    filtro = []
    for vehiculo in vehiculos:
        if vehiculo.precio < 10000:
            filtro.append('bajo')
        elif vehiculo.precio >= 10000 and vehiculo.precio < 30000:
            filtro.append('medio')
        elif vehiculo.precio >= 30000:
            filtro.append('alto')

